import "./InformationSection.css";

var regionStructure = {
    title: "Структура потребления по регионам",
    catagories: [
      {
        name: "Китай",
        value: 33,
        color: "#ff6384",
      },
      {
        name: "Европа",
        value: 25,
        color: "#ff9f40",
      },
      {
        name: "Северная Америка",
        value: 24,
        color: "#ffcd56",
      },
      {
        name: "Юв. Азия",
        value: 13,
        color: "#4bc0c0",
      },
      {
        name: "Остальной мир",
        value: 5,
        color: "#36a2eb",
      },
    ],
};

var globalButanolMarket = {
    title: "Мировой рынок бутанола",
    categories: [
        {
            name: "2020",
            value: 3.1,
            valuePostfix: "млрд $", 
            color: "#FFFFFF"
        }, 
        {
            name: "2025",
            value: 4,
            valuePostfix: "млрд $",
            color: "#ABB466"
        }
    ],
}


function TableSectionCreator(){
    var rows = [];
    for (var i = 0; i < numrows; i++) {
        rows.push(ObjectRow());
    }
    return div(rows);
}


function MarketOverviewSection(){
    return(
        <div id="business_model" className="container">
            <div class="container__half">
                <ul>
                {this.state.items.map((item) => {
                <div key={item.id} name={item.name} />
                    })}
                </ul>
            </div>
            <div class="container__half">
                
            </div>
        </div>
    )
}

export default MarketOverviewSection;
